Hey everyone, we need your help! 

Asking people to go vote for our @sxsw label. Every vote counts to make sure our voices are heard. We put together an amazing panel of Korean beverages entrepreneurs for our proposed SXSW panel:

K-Cheers!
The Korean wave has hit our grocery store shelves with these leading Korean inspired beverage brands. Learn from the founders of Makku, Ginsa, and Hummy about their journey in building a brand infused with culture and Korean inspired flavors.

Who it’s for:
Anyone who is interested in Korean culture, CPG startups, and marketing should attend.

What they’ll learn:
1. How these founders decided to build brands rooted in authentic Korean culture
2. How to build a supportive and powerful community 
 to help drive awareness and sales
3. Lessons and challenges in fundraising for a “niche” brand. 

